import React from "react"
import axios from "axios"


export default class NorthAmerica extends React.Component {
    state = {
        city: []
    };
    componentDidMount() {
        axios.get(`http://localhost:2500/importantCities`)
          .then(res => {
            const city = res.data;
            this.setState({ city });
          })
      }

      render() {
        if (this.state.city === undefined) {
          return <h1>Not here</h1>;
        }
        return (
          <div className="cities-container">
            {console.log(this.state.city)}
            { this.state.city.citiesInstance
            .filter(city=> city.continent[0] === "North America")
            .map(city=> <div key={city._id} className="cities"><p>{city.name}</p></div>)}


          </div>
        );
      }
    }
